
public class registerpojo {
	private String rfname;
	private String rlname;
	private String rmail;
	private String rpwd;
	private String rgender;
	private String rcountry;
	private int rcont;
	public registerpojo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public registerpojo(String rfname, String rlname, String rmail, String rpwd, String rgender, String rcountry,
			int rcont) {
		super();
		this.rfname = rfname;
		this.rlname = rlname;
		this.rmail = rmail;
		this.rpwd = rpwd;
		this.rgender = rgender;
		this.rcountry = rcountry;
		this.rcont = rcont;
	}
	public String getRfname() {
		return rfname;
	}
	public void setRfname(String rfname) {
		this.rfname = rfname;
	}
	public String getRlname() {
		return rlname;
	}
	public void setRlname(String rlname) {
		this.rlname = rlname;
	}
	public String getRmail() {
		return rmail;
	}
	public void setRmail(String rmail) {
		this.rmail = rmail;
	}
	public String getRpwd() {
		return rpwd;
	}
	public void setRpwd(String rpwd) {
		this.rpwd = rpwd;
	}
	public String getRgender() {
		return rgender;
	}
	public void setRgender(String rgender) {
		this.rgender = rgender;
	}
	public String getRcountry() {
		return rcountry;
	}
	public void setRcountry(String rcountry) {
		this.rcountry = rcountry;
	}
	public int getRcont() {
		return rcont;
	}
	public void setRcont(int rcont) {
		this.rcont = rcont;
	}
	
	
	
	

}
